Ad Text:
We’re partnering with a high-performing MSP looking for a strong Level 2–3 Systems Engineer to join their close-knit technical team. This is a hands-on role suited to someone who enjoys ownership, variety and being the escalation point.

You’ll be supporting a diverse client base across SME and mid-market environments, working across BAU, projects and escalations. The role sits across infrastructure, cloud and modern workplace technologies.

What you’ll be doing:

Acting as the L2/3 escalation point for complex technical issues;
Managing and supporting Microsoft 365, Azure AD and Intune environments;
Supporting Windows Server, Active Directory, Group Policy and core infrastructure;
Working across virtualisation (VMware / Hyper-V);
Handling networking fundamentals (firewalls, switches, VPNs);
Delivering client projects including migrations, upgrades and cloud transitions; and
Contributing to documentation and continuous improvement.
What we’re looking for:

4+ years’ experience in an MSP environment (this is important);
Strong troubleshooting capability across server, cloud and endpoint;
Exposure to Azure infrastructure and M365 stack;
Solid communication skills – client-facing confidence is key; and
Someone proactive who takes ownership, not just tickets.
This is a great opportunity to join a well-run MSP with strong leadership, good technical standards and genuine growth opportunities.

How to Apply

For more information or a confidential discussion please call Mariam Iskandar at u&u on 02 8245 7904 quoting reference number 44353

